INSERT INTO `corsi` (`corsi_id`, `titolo`, `descrizione`, `immagine`, `descrizione_long`) VALUES
(1, 'Funktional', 'Un <span xml:lang=\"en\">workout </span>unico, pensato per chi vuole trovare il giusto mix tra il lavoro cardio-coreografico (<span xml:lang=\"en\">funk</span>) e l\'allenamento <span xml:lang=\"en\">super-fun</span> per tonificare e rassodare attraverso un intenso lavoro <span xml:lang=\"en\">total body</span>', , '');
INSERT INTO `corsi` (`corsi_id`, `titolo`, `descrizione`, `immagine`, `descrizione_long`) VALUES
(2, 'Fitboxe', 'Se sei stressato e hai voglia di sfogare la tensione della giornata è l\'allenamento perfetto! Un esercizio che combina CARDIO e TONO, assemblando PUGNI, CALCI e GOMITATE a ritmo di musica, perfetto per uomini, donne, grandi e piccini!', , '');
INSERT INTO `corsi` (`corsi_id`, `titolo`, `descrizione`, `immagine`, `descrizione_long`) VALUES
(3, 'Ginnastica dolce', 'Un corso nella quale prevalgono movimenti lenti e graduali e attenta respirazione, eseguiti\r\n		   al corpo libero senza richiedere uno sforzo particolare di chi la pratica.\r\n		   Particolarmente indicata per chi ha problemi di postura, agli anziani e a donne in gravidanza!', , '<p>Movimenti lenti, attenta respirazione, benessere a 360 gradi: queste, in sintesi, le caratteristiche della ginnastica dolce, una disciplina sportiva orientata al benessere capace di adattarsi alle esigenze di sportivi e non. Un tipo di attività motoria nella quale prevalgono movimenti lenti e graduali, eseguiti al corpo libero senza richiedere uno sforzo particolare a chi la pratica.</p>\r\n\r\n<p>\r\nVediamo, dunque, come funziona, che benefici ha e a chi è più indicata come disciplina per mantenersi in forma. Come anticipato, si tratta di uno sport che prevede esercizi graduali e mirati, che vanno ad agire in maniera specifica su alcuni muscoli: l’obiettivo è allenare il corpo allo sport senza stressarlo in maniera eccessiva. Quindi, vengono eseguiti in serie: allungamenti, distensioni, stretching e addominali di vario genere che vanno ad agire sulla flessibilità del tono muscolare e sulle articolazioni. Non mancano anche movimenti specifici mirati alla distensione della colonna vertebrale e dei muscoli del collo che spesso determinano irrigidimenti e mal di schiena.</p>');
INSERT INTO `corsi` (`corsi_id`, `titolo`, `descrizione`, `immagine`, `descrizione_long`) VALUES
(4, 'Step &amp; total body', 'Un allenamento indicato per tutti coloro che amano il fitness e che desiderano praticare\r\n		   una combinazione tra allenamento di RESISTENZA e FORZA a ritmo di musica!', , '');
INSERT INTO `corsi` (`corsi_id`, `titolo`, `descrizione`, `immagine`, `descrizione_long`) VALUES
(5, 'Ginnastica dolce', 'Un corso nella quale prevalgono movimenti lenti e graduali e attenta respirazione, eseguiti\r\n		   al corpo libero senza richiedere uno sforzo particolare di chi la pratica.\r\n		   Particolarmente indicata per chi ha problemi di postura, agli anziani e a donne in gravidanza!', '', ''),
(6, 'Step &amp; total body', 'Un allenamento indicato per tutti coloro che amano il fitness e che desiderano praticare\r\n		   una combinazione tra allenamento di RESISTENZA e FORZA a ritmo di musica!', '', '');

